MultiLanguageSpellData['de'][79972] = {name = "Siegel der Wahrheit", additional_info = "14% von Grundmana\nSofort\n[q]Erfüllt den Paladin mit heiliger Macht, durch den Angriffe auf Einzelziele den Effekt 'Tadel' auslösen, der im Verlauf von 15 sec [(0.01 * Spell power + 0.0193 * Attack power) * 5 */ 100] zusätzlichen Heiligschaden verursacht. 'Tadel' ist bis zu 5-mal stapelbar. Sobald 5 Stapel erreicht werden, verursacht jeder Angriff des Paladins zusätzlich 15% Waffenschaden als Heiligschaden. Es kann immer nur jeweils ein Siegel auf dem Paladin aktiv sein. Hält 5 min lang an.\n\n Die Entfesselung der Energie dieses Siegels fügt einem Feind (1 + 0.223 * Spell power + 0.142 * Attack power) Heiligschaden zu, dieser Schaden wird für jeden Stapel von 'Tadel' auf dem Ziel um 10% erhöht."}
