MultiLanguageSpellData['de'][84408] = {name = "[q3]R19-Bedrohungsfinder", additional_info = "Wirken in 2 sek. 5\nTools: Schmiedehammer , Gyromatischer Mikroregler\nReagenzien:\nObsidiumbarren (6), Eine Handvoll Obsidiumbolzen (6), Alazit (2)\n[q3]R19-Bedrohungsfinder\n80\n[q2]Benutzen: Verbindet ein Zielfernrohr dauerhaft mit einem Bogen oder einer Schusswaffe, sodass die Distanztrefferwertung dieser Waffe um 88 erhöht wird.\n\n Durch das Anbringen des Fernrohrs an die Fernkampfwaffe wird diese seelengebunden."}
