MultiLanguageSpellData['de'][84410] = {name = "[q3]Sicherungshebelentfernungssatz", additional_info = "Wirken in 2 sek. 5\nTools: Gyromatischer Mikroregler\nReagenzien:\nObsidiumbarren (10), Eine Handvoll Obsidiumbolzen (10)\n[q3]Sicherungshebelentfernungssatz\n80\n[q2]Benutzen: Blockiert den Sicherungsmechanismus eines Bogens oder einer Schusswaffe, sodass die Distanztempowertung der Fernkampfwaffe um 88 erhöht wird.\n\n Durch das Deaktivieren der Sicherung einer Fernkampfwaffe wird diese seelengebunden."}
MultiLanguageSpellData['de'][84411] = {name = "[q3]Hochleistungsbolzenschusspistole", additional_info = "Wirken in 4 sek. 5\nTools: Schmiedehammer , Gyromatischer Mikroregler\nReagenzien:\nObsidiumbarren (10), Eine Handvoll Obsidiumbolzen (8), Elektrifizierter Äther (4)\n[q3]Hochleistungsbolzenschusspistole\nWird bei Benutzung gebunden\nBenötigtIngenieurskunst\n(450)\n[q2]Benutzen: Feuert einige geladene Bolzen auf einen Feind ab und verursacht so 8860 Schaden, ebenso wird ein gewirkter Zauber kurzzeitig unterbrochen. Verbraucht mit jedem Schuss eine Hand voll Obsidiumbolzen. (2 Min Abklingzeit)\n[q]\"Fast so schwer zu bedienen wie herzustellen.\""}
MultiLanguageSpellData['de'][84412] = {name = "[q3]Persönlicher Weltenzerstörer", additional_info = "Wirken in 2 sek. 5\nTools: Hochleistungsbolzenschusspistole , Schmiedehammer\nReagenzien:\nObsidiumbarren (10), Eine Handvoll Obsidiumbolzen (8), Elektrifizierter Äther (8)\n[q3]Persönlicher Weltenzerstörer\n[q2]Benutzen: Lehrt Euch, wie man dieses Haustier beschwört.\n[q2]Mit Rechtsklick Euren persönlichen Weltenzerstörer beschwören oder wieder freigeben."}
MultiLanguageSpellData['de'][84413] = {name = "[q3]Entwaffneter mechanischer Begleiter", additional_info = "Wirken in 2 sek. 5\nTools: Hochleistungsbolzenschusspistole , Bogenlichtschraubenschlüssel\nReagenzien:\nObsidiumbarren (12), Eine Handvoll Obsidiumbolzen (4), Elektrifizierter Äther (8), Jaspis (2)\n[q3]Entwaffneter mechanischer Begleiter\n[q2]Benutzen: Lehrt Euch, wie man dieses Haustier beschwört.\n[q2]Mit Rechtsklick Euren entwaffneten mechanischen Begleiter beschwören oder wieder freigeben."}
