MultiLanguageSpellData['de'][84416] = {name = "[q3]Elementiumwerkzeugkasten", additional_info = "Wirken in 5 sek. 5\nTools: Schmiedehammer\nReagenzien:\nElementiumbarren (15), Flüchtige Erde (12)\n[q3]Elementiumwerkzeugkasten\nWird beim Anlegen gebunden\n36 Platz Ingenieurstasche\n[q]\"Möglicherweise der schönste Werkzeugkasten, der jemals erschaffen wurde, mit goldenen Intarsien.\""}
MultiLanguageSpellData['de'][84417] = {name = "[q3]Unberechenbarer Donnerstock", additional_info = "Wirken in 2 sek. 5\nTools: Schmiedehammer , Gyromatischer Mikroregler\nReagenzien:\nElektrifizierter Äther (2), Gehärteter Elementiumbarren (5), Flüchtiges Feuer (6)\n[q3]Unberechenbarer Donnerstock\nWird beim Anlegen gebunden\nDistanz Schusswaffe\n958 - 1,781 Schaden Tempo 2.80\n(489.11 Schaden pro Sekunde)\n+84 Beweglichkeit\n+126 Ausdauer\n[q2]Erhöht Eure Meisterschaftswertung um + 56.\nHaltbarkeit 75 / 75\n83\n[q2]Anlegen: Erhöht die kritische Trefferwertung um 56."}
MultiLanguageSpellData['de'][84418] = {name = "[q3]Elementiumdrachling", additional_info = "Wirken in 2 sek. 5\nTools: Schmiedehammer , Hochleistungsbolzenschusspistole\nReagenzien:\nEine Handvoll Obsidiumbolzen (2), Elektrifizierter Äther (8), Elementiumbarren (16), Glutseidenstoff (20)\n[q3]Elementiumdrachling\nWird beim Anlegen gebunden\nEinzigartig anlegbarSchmuck\n[q2]Erhöht Eure Meisterschaftswertung um + 252.\n80\nBenötigtIngenieurskunst\n(475)\n[q2]Benutzen: Aktiviert Euren Elementiumdrachling, der 1 min lang für Euch kämpft. (5 Min Abklingzeit)"}
