MultiLanguageSpellData['de'][84420] = {name = "[q3]Feinabgestimmter Kehlennadler", additional_info = "Wirken in 2 sek. 5\nTools: Schmiedehammer , Bogenlichtschraubenschlüssel\nReagenzien:\nObsidiumbarren (4), Elektrifizierter Äther (2), Gehärteter Elementiumbarren (5)\n[q3]Feinabgestimmter Kehlennadler\nWird beim Anlegen gebunden\nDistanz Armbrust\n993 - 1,844 Schaden Tempo 2.90\n(489.14 Schaden pro Sekunde)\n+84 Beweglichkeit\n+126 Ausdauer\nHaltbarkeit 75 / 75\n83\n[q2]Anlegen: Erhöht die kritische Trefferwertung um 49.\n[q2]Anlegen: Erhöht die Tempowertung um 60."}
