MultiLanguageSpellData['de'][84424] = {name = "Unsichtbarkeitsfeld", additional_info = "Wirken in 5 sek.\nBenötigt Gürtel\nTools: Bogenlichtschraubenschlüssel\nReagenzien:\nEine Handvoll Obsidiumbolzen , Elektrifizierter Äther\n[q]Bringt an einem Gürtel dauerhaft tausende winziger Spiegel an, die es Euch gestatten, außerhalb des Kampfes unsichtbar zu werden. Kann ein Mal alle 5 Min. ausgelöst werden.\n\n Kann nur an Euren eigenen Gürtel angebracht werden und er wird dadurch seelengebunden. Benötigt eine Ingenieursfertigkeit von mindestens 500."}
MultiLanguageSpellData['de'][84425] = {name = "Pappkamerad", additional_info = "Wirken in 5 sek.\nBenötigt Gürtel\nTools: Bogenlichtschraubenschlüssel\nReagenzien:\nEinfaches Holz (2), Eine Handvoll Obsidiumbolzen\n[q]Bringt an Euren Gürtel permanent ein winziges Gerät an, welches es Euch gestattet, einen Pappkameraden aufzustellen, den Gegner angreifen werden. Hält 15 sec lang an. Kann nur ein Mal alle 5 Min. ausgelöst werden.\n\n Kann nur an Eurem eigenen Gürtel angebracht werden und durch das Anbringen wird der Gegenstand seelengebunden. Benötigt eine Ingenieursfertigkeit von mindestens 500."}
MultiLanguageSpellData['de'][84426] = {name = "Teufelsatem", additional_info = "Nahkampfreichweite\nWirken in 2.5 sek.\n[q]Fügt Feinden in einem kegelförmigen Bereich vor dem Zaubernden Feuerschaden zu."}
MultiLanguageSpellData['de'][84427] = {name = "Geerdeter Plasmaschild", additional_info = "Wirken in 5 sek.\nBenötigt Gürtel\nTools: Bogenlichtschraubenschlüssel\nReagenzien:\nElektrifizierter Äther (3)\n[q]Bringt an einem Gürtel dauerhaft geerdete Plasmageneratoren an, die es Euch gestatten, einen machtvollen Schild zu aktivieren, der 16200 to 19800 Schaden absorbiert. Kann nur ein Mal alle 5 Min. genutzt werden.\n\n Kann nur an Euren eigenen Gürtel angebracht werden und er wird dadurch seelengebunden. Benötigt eine Ingenieursfertigkeit von mindestens 500."}
MultiLanguageSpellData['de'][84428] = {name = "[q3]Gnomisches Röntgenzielfernrohr", additional_info = "Wirken in 2 sek. 4\nTools: Schmiedehammer , Gyromatischer Mikroregler\nReagenzien:\nGehärteter Elementiumbarren (2), Traumsmaragd (2)\n[q3]Gnomisches Röntgenzielfernrohr\n80\n[q2]Benutzen: Verbindet ein Zielfernrohr dauerhaft mit einem Bogen oder einer Schusswaffe, sodass manchmal die Distanzangriffskraft dieser Waffe 10 sec lang um 800 erhöht wird, wenn Ihr Distanzschaden verursacht.\n\n Durch das Anbringen des Fernrohrs an die Fernkampfwaffe wird diese seelengebunden."}
MultiLanguageSpellData['de'][84429] = {name = "Goblinbarbecue", additional_info = "Wirken in 2 sek.\nTools: Hochleistungsbolzenschusspistole , Bogenlichtschraubenschlüssel\nReagenzien:\nElementiumbarren (2), Zähes Fleisch (2), Lavaschuppenfilet (2)\n80\nBenötigtKochkunst\n(475)\n[q2]Benutzen: Richtet für Eure Gruppe oder Euren Schlachtzug ein Goblinbarbecuefestmahl her! Stellt im Verlauf von 30 sec 67500 Gesundheit und 45000 Mana wieder her. Wenn Ihr mindestens 10 Sekunden lang mit Essen verbringt, werdet Ihr satt und erhaltet 1 hour lang 60 Ausdauer und ein für Euch nützlicher Wert wird um 60 erhöht."}
MultiLanguageSpellData['de'][84430] = {name = "Hitzebehandelter Spinnerbait", additional_info = "Wirken in 2 sek.\nTools: Bogenlichtschraubenschlüssel , Gyromatischer Mikroregler\nReagenzien:\nEine Handvoll Obsidiumbolzen , Elementiumbarren (4), Flüchtiges Feuer\n(2)\nBenötigtAngeln\n(250)\n[q2]Benutzen: Bei Anwendung auf Eure Angelrute wird die Fähigkeit 'Angeln' 15 Minuten lang um 150 Punkte erhöht.\n[q]\"Funktioniert sogar in Lava!\""}
MultiLanguageSpellData['de'][84431] = {name = "[q3]Übermotorisierter Hühnerspalter", additional_info = "Wirken in 2 sek.\nTools: Schmiedehammer , Bogenlichtschraubenschlüssel\nReagenzien:\nGehärteter Elementiumbarren (12), Echtgold (2), Eine Handvoll Obsidiumbolzen (6), Elektrifizierter Äther (8), Chaoskugel\n[q3]Übermotorisierter Hühnerspalter\nWird beim Anlegen gebunden\nDistanz Bogen\n1,082 - 2,010 Schaden Tempo 2.80\n(552.14 Schaden pro Sekunde)\n+95 Beweglichkeit\n+143 Ausdauer\nHaltbarkeit 75 / 75\n85\n[q2]Anlegen: Erhöht die kritische Trefferwertung um 68.\n[q2]Anlegen: Erhöht die Tempowertung um 56."}
MultiLanguageSpellData['de'][84432] = {name = "[q3]Rückstoß 5000", additional_info = "Wirken in 2 sek.\nTools: Schmiedehammer , Bogenlichtschraubenschlüssel\nReagenzien:\nGehärteter Elementiumbarren (9), Echtgold (3), Haarfeiner Sprengstoffauslöser , Schäftung aus Walnussholz , Chaoskugel\n[q3]Rückstoß 5000\nWird beim Anlegen gebunden\nDistanz Schusswaffe\n1,082 - 2,010 Schaden Tempo 2.80\n(552.14 Schaden pro Sekunde)\n+75 Beweglichkeit\n+143 Ausdauer\n\n[q0]Roter Sockel\n[q0]Sockelbonus: +10 Beweglichkeit\n\nHaltbarkeit 75 / 75\n85\n[q2]Anlegen: Erhöht die kritische Trefferwertung um 65.\n[q2]Anlegen: Erhöht die Tempowertung um 42."}
