MultiLanguageSpellData['de'][89890] = {name = "[q0]Unheimlicher Gluthauergötze", additional_info = "Wirken in 3 sek. 5\n[q]Als die Hochelfen in den Krieg gegen die Amanitrolle zogen, konnten die Elfen nicht verstehen, wie die Waffenverzauberungen der Trolle mächtiger als ihre eigenen sein konnten. Daraufhin stahlen die Elfen das uralte Wissen der Trollzauberer, einschließlich dem des berühmten Zanza, und nutzten Idole wie dieses hier, um ihre eigenen Versionen der Trollverzauberungen zu erschaffen.\n[q0]Unheimlicher Gluthauergötze\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][89891] = {name = "[q0]Cinnabaritschmuckstück", additional_info = "Wirken in 3 sek. 5\n[q]Dieses Kleinod wurde aus einem roten Mineral vulkanischen Ursprungs hergestellt, das nebenbei sehr giftig ist. Die Inschrift auf der Rückseite besagt, dass es einst Eigentum von Min'loth der Schlange war. Spuren von Seepocken deuten darauf hin, dass das Schmuckstück einige Zeit unter Wasser verbracht hat.\n[q0]Cinnabaritschmuckstück\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][89892] = {name = "Bombe werfen", additional_info = "15 Meter Reichweite\nSofort\n[q]Wirft eine Bombe auf einen nahen Ölspritzer, um ihn anzuzünden."}
MultiLanguageSpellData['de'][89893] = {name = "[q0]Münze aus Eldre'Thalas", additional_info = "Wirken in 3 sek. 5\n[q]Einstmals war dieser Ort eine Hauptstadt der Hochgeborenen, die Stadt von Königin Azsharas Arkanisten. Nach der Großen Zerschlagung fiel sie jedoch dem Verfall und letztendlich dem Vergessen anheim. Die Ruine ist nunmehr als der Düsterbruch bekannt.\n[q0]Münze aus Eldre'Thalas\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][89894] = {name = "[q0]Zerschmetterte Gleve", additional_info = "Wirken in 3 sek. 5\n[q]Das ist das Fragment eines großen, mit drei Klingen versehenen Projektiltyps, der von elfischen Belagerungswaffen verschossen wird. Wenn Glevenwerfer auch heute noch in Gebrauch sind, so ist dieses Fragment doch eindeutig altertümlich und äußerst reich verziert, selbst für nachtelfische Verhältnisse.\n[q0]Zerschmetterte Gleve\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][89895] = {name = "[q0]Spiralförmige Ammonitenschale", additional_info = "Wirken in 3 sek. 5\n[q]Ammoniten sind eine ausgestorbene Kopffüßlerart, die verschiedenartig gewundene Schalen besaß. Dies ist ein Fossil eines kleinen Exemplars, sie konnten jedoch recht groß werden.\n[q0]Spiralförmige Ammonitenschale\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][89896] = {name = "[q0]Gründrachenring", additional_info = "Wirken in 3 sek. 5\n[q]Das ist vermutlich eine künstlerische Darstellung von Eranikus, Gemahl von Ysera. Eranikus fiel der Verderbnis des Smaragdgrünen Alptraums anheim und wurde später erlöst. In die Innenseite sind die Worte 'Andu-falah-dor!' graviert.\n[q0]Gründrachenring\nWird beim Aufheben gebunden"}
