MultiLanguageSpellData['de'][90410] = {name = "[q0]Gekerbtes Schwert von Tunadil dem Erlöser", additional_info = "Wirken in 3 sek. 5\n[q]Die Klinge zerbrach, als der Paladin im Kampf gegen den Schreckenswyrm Kaldrigos auf sie stürzte.\n[q0]Gekerbtes Schwert von Tunadil dem Erlöser\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][90411] = {name = "[q0]Üppiger Türklopfer", additional_info = "Wirken in 3 sek. 5\n[q]Ihr könnt nur spekulieren, welche Art Wohnhaus oder Geschäft dieses Artefakt einst zierte. Dieser, äh... dralle Türklopfer hat die Form einer vollbusigen Zwergin, die mit breitem Lächeln mehrere Bierhumpen vor sich herträgt. Das Lächeln hat eindeutig eine Zahnlücke.\n[q0]Üppiger Türklopfer\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][90412] = {name = "[q0]Stiefelabsatz mit Ornamenten", additional_info = "Wirken in 3 sek. 5\n[q]Die Aufmerksamkeit, die diesem einzelnen Absatz geschenkt wurde, lässt darauf schließen, dass der gesamte Stiefel einst magische Qualitäten aufwies. Die Ornamente sind größtenteils abstrakt, Ihr könnt jedoch kleine Waldtiere ausmachen - Eichhörnchen, Rehe, vielleicht ein Stinktier - die in dem verschnörkelten Muster versteckt sind.\n[q0]Stiefelabsatz mit Ornamenten\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][90413] = {name = "[q0]Goldener Nachttopf", additional_info = "Wirken in 3 sek. 5\n[q]Anscheinend erledigen die Reichen und Mächtigen all ihre Geschäfte mit Stil. Dieses gute Stück ist mit Fischen verziert, die aus stilisiertem Wasser springen.\n[q0]Goldener Nachttopf\nWird beim Aufheben gebunden"}
