MultiLanguageSpellData['de'][90419] = {name = "[q0]Eisensterns versteinerter Schild", additional_info = "Wirken in 3 sek. 5\n[q]Der Legende nach schnitzte der Dunkeleisenthan Eisenstern diesen Schild aus dem Holz eines heiligen Baumes der Hochelfen und verzauberte ihn, auf dass er so hart wie Stein werde.\n[q0]Eisensterns versteinerter Schild\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][90420] = {name = "[q0]Schädelförmiger Blumentopf", additional_info = "Wirken in 3 sek. 5\n[q]Waldtrolle haben eine starke Affinität zur umgebenden Flora. Die Körper der Trolle selbst können Heimat simpler Pflanzenkulturen sein, zum Beispiel von Moosen oder Algen, was ihnen ihre charakteristische grüne Farbschattierung verleiht.\n[q0]Schädelförmiger Blumentopf\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][90421] = {name = "[q0]Jadearmband mit Münzen", additional_info = "Wirken in 3 sek. 5\n[q]Dieses Armband besteht aus einem Silberkettchen, an dem polierte Jadesteine und trollische Münzen befestigt sind. Da Trolle eher Gold als Schmuckmaterial bevorzugen, ist es möglich, dass das Silber von einem anderen Volk erbeutet wurde - was wiederum bedeutet, dass dieser Fund jüngeren Ursprungs ist. Die Münzen sind ungewöhnlich, auf jeder ist das Gesicht einer anderen Trollfrau dargestellt.\n[q0]Jadearmband mit Münzen\nWird beim Aufheben gebunden"}
