MultiLanguageSpellData['de'][90423] = {name = "[q0]Figur von Gahz'rilla", additional_info = "Wirken in 3 sek. 5\n[q]Die Sandtrolle beschworen diese gewaltige weiße Hydra aus einem heiligen Wasserbecken in Zul'Farrak und verehrten sie daraufhin als Gottheit. Gahz'rillas Schuppen sind elektrisch aufgeladen und selbst diese kleine Figur knistert vor Energie. Innerhalb von Zul'Farrak ist die legendäre Hydra ein häufig auftretendes architektonisches und ornamentales Motiv.\n[q0]Figur von Gahz'rilla\nWird beim Aufheben gebunden"}
