MultiLanguageSpellData['de'][90429] = {name = "[q0]Szepter der Atal'ai", additional_info = "Wirken in 3 sek. 5\n[q]'Atal'ai' heißt 'die Ergebenen' auf Zandali, und diese Gruppe missgeleiteter Trolle war dem Blutgott Hakkar ergeben: Einem Wesen von extremer Bösartigkeit, das vor Kurzem seine Niederlage in Zul'Gurub erleben musste, der uralten Hauptstadt des Reiches der Gurubashi. Dieses Szepter ist mit einem Fledermausmotiv verziert. Vermutlich besteht eine Verbindung mit Hir'eek, dem uralten Fledermausgott.\n[q0]Szepter der Atal'ai\nWird beim Aufheben gebunden"}
