MultiLanguageSpellData['de'][90432] = {name = "[q0]Zahn eines Teufelssauriers", additional_info = "Wirken in 3 sek. 5\n[q]Teufelssaurier sind die größte Raubtierart, die jemals auf Azeroth lebte. Auch wenn der Großteil vor langer Zeit ausstarb, gedeihen wenige Exemplare weiterhin in isolierten Gebieten. Es gibt viele Spekulationen über den Zweck der verkümmerten Arme der Teufelssaurier. Eine Theorie lautet, dass sie ihnen beim Aufstehen behilflich sind. Eine andere, dass sie dazu dienen, Weibchen zu kitzeln. Weitere Beobachtungen sind erforderlich.\n[q0]Zahn eines Teufelssauriers\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][90433] = {name = "[q0]In Bernstein eingeschlossenes Insekt", additional_info = "Wirken in 3 sek. 5\n[q]Bernstein ist versteinertes Baumharz. Einer der Zwecke von Baumharz besteht darin, den Baum vor Schädlingen zu schützen. Daher kann es vorkommen, dass einige seltene Bernsteine von ihrem Harz umschlossene Insekten beinhalten.\n[q0]In Bernstein eingeschlossenes Insekt\nWird beim Aufheben gebunden"}
