MultiLanguageSpellData['de'][90451] = {name = "[q0]Amphore der Kaldorei", additional_info = "Wirken in 3 sek. 5\n[q]Dieser schlanke Krug mit den ovalen Henkeln wurde zum Mischen oder Aufbewahren darnassischen Weins genutzt. Selbst nach all dieser Zeit steigt Euch von den angetrockneten Resten im Inneren noch ein leichter Ingwerduft entgegen.\n[q0]Amphore der Kaldorei\nWird beim Aufheben gebunden"}
