MultiLanguageSpellData['de'][90464] = {name = "[q3]Seelenspiegel der Hochgeborenen", additional_info = "Wirken in 3 sek. 15\n[q]Vor der Großen Zerschlagung waren die Hochgeborenen unter den Nachtelfen für ihre Arroganz, Habgier und ihre extravagante Kleidung bekannt. Es heißt, dass die Hochgeborenen keinen Anblick als so angenehm empfanden, wie den eigenen. Solche Spiegel wurden erschaffen, damit die elfischen Damen ihre farbenfrohen Gewänder in drei Dimensionen bewundern konnten, wobei das Spiegelbild die oft bereits verkommenen Gesichtszüge der Betrachterin gern schmeichelhaft darstellte.\n[q3]Seelenspiegel der Hochgeborenen\nWird beim Aufheben gebunden\nSpielzeug\n[q2]Benutzen: Blickt in den Spiegel... (10 Min Abklingzeit)"}
