MultiLanguageSpellData['de'][90493] = {name = "[q3]Statuenpaar: Druidin und Priester", additional_info = "Wirken in 3 sek. 15\n[q]Es war eine fundamentale Umwälzung der gesellschaftlichen Ordnung, als es nachtelfischen Männern gestattet wurde, Priester zu werden und nachtelfischen Frauen den Pfad des Druidentums einzuschlagen. Für tausende von Jahren waren diese Positionen einem Geschlecht vorbehalten gewesen. Dieses Statuenpaar erinnert an jene chaotischen, bewegenden Tage.\n[q3]Statuenpaar: Druidin und Priester\nWird beim Aufheben gebunden\nSpielzeug\n[q2]Benutzen: Beschwört einen Quell des Wissens. (15 Min Abklingzeit)"}
