MultiLanguageSpellData['de'][90504] = {name = "[q0]Der verbeulte Schild des Horuz Krähentod", additional_info = "Wirken in 3 sek. 5\n[q]Als Horuz und seine Gefährten den Schreckenswyrm Kaldrigos bekämpften, beging der sagenumwobene Held einen tödlichen Fehler. Er stand direkt hinter dem Drachen. Tut das nie.\n[q0]Der verbeulte Schild des Horuz Krähentod\nWird beim Aufheben gebunden"}
