MultiLanguageSpellData['de'][90509] = {name = "[q0]Szepter von Charlga Klingenflanke", additional_info = "Wirken in 3 sek. 5\n[q]Auch wenn diese Artefaktfragmente mit zwergischen vermischt waren, ist dieses Szepter eindeutig nicht von Zwergenhand, sondern von Stachelebern gefertigt. In der Tat wurde es einst von Charlga Klingenflanke selbst geführt. Möglicherweise kam es in den Besitz von Zwergen, als Helden versuchten, den Kral der Klingenhauer einzunehmen.\n[q0]Szepter von Charlga Klingenflanke\nWird beim Aufheben gebunden"}
