MultiLanguageSpellData['de'][90518] = {name = "[q0]Mithrilkette von Zornesschmied", additional_info = "Wirken in 3 sek. 5\n[q]Die Familienlinie der Zornesschmied durchzieht die gesamte Geschichte der Dunkeleisenzwerge. Das ist eine Kette, die von Than Zornesschmied getragen wurde, dem Vorfahren von General Zornesschmied, der noch immer die Armeen des Dunkeleisenklans im Schwarzfels befehligt.\n[q0]Mithrilkette von Zornesschmied\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][90519] = {name = "[q0]Schädelstab von Schattenschmiede", additional_info = "Wirken in 3 sek. 5\n[q]Die Familie Schattenschmiede hinterließ einen Schandfleck auf der Geschichte der Dunkeleisenzwerge. Eisenthan Schattenschmiede war allen Berichten zufolge ein grausamer Despot, der viele seiner eigenen Untertanen folterte und tötete. Allgemein wird angenommen, er sei ein Hexenmeister gewesen, dennoch halten sich hartnäckige Gerüchte, dass er einer der ersten zwergischen Schamanen war.\n[q0]Schädelstab von Schattenschmiede\nWird beim Aufheben gebunden"}
