MultiLanguageSpellData['de'][90521] = {name = "[q3]Aufziehgnom", additional_info = "Wirken in 3 sek. 15\n[q]Mechagnome wurden von den Titanen erschaffen und sie fungierten, ähnlich wie die Irdenen, als Diener und Hüter. Dieser Mechagnom wurde vermutlich beschädigt, denn statt seiner ursprüngliche Aufgabe nachzugehen scheint er ganz damit zufrieden zu sein, Euch einfach nur nachzulaufen.\n[q3]Aufziehgnom\nWird beim Aufheben gebunden\n[q2]Benutzen: Lehrt Euch, wie man dieses Haustier beschwört.\n[q2]Mit Rechtsklick Euren Aufziehgnom beschwören oder wieder freigeben."}
MultiLanguageSpellData['de'][90522] = {name = "Wasserhülle", additional_info = "40 Meter Reichweite\nWirken in 2 sek.\n[q]Absorbiert 50000 Schaden. Wenn die Wasserhülle bricht, explodiert sie und fügt Feinden in einem Umkreis von 8 Metern 48750 to 51250 Frostschaden zu."}
