MultiLanguageSpellData['de'][90553] = {name = "[q3]Kelch der Bergkönige", additional_info = "Wirken in 3 sek. 15\n[q]Zusätzlich zum dichten Edelsteinzierat ist dieser Kelch über und über mit Runen bedeckt, welche die Thronbesteigungszeremonie eines Zwergenkönigs rühmen. Obwohl es sicherlich Teil dieser Zeremonie war, aus diesem Kelch zu trinken, beschreiben die Runen dennoch einen \"Schwerttanz\", der von Zwergenkriegerinnen dargeboten wurde. Diese Aufführung - teils Ritual, teils Schaukampf - entwickelte sich aus blutigen Duellen, die einst in weniger kultivierten Zeitaltern der zwergischen Geschichte stattfanden.\n[q3]Kelch der Bergkönige\nWird beim Aufheben gebunden\nSpielzeug\n[q2]Benutzen: Werdet Zeuge eines historischen Schwerttanzes. (10 Min Abklingzeit)"}
