MultiLanguageSpellData['de'][90581] = {name = "[q0]Opfermesser der Drakkari", additional_info = "Wirken in 3 sek. 5\n[q]Der Stamm der Drakkari wurde von anderen Trollen in Richtung Norden verdrängt, wo sie sich schließlich niederließen und in dem harschen Ödland ihre eigene Nation gründeten. Die Ankunft des Lichkönigs stellte für die Drakkari eine große Bedrohung dar. Eine ihrer am wenigsten sinnvollen Kriegsanstrengungen gegen den Lichkönig bestand darin, ihre eigenen Tiergötter zu opfern: Schlange, Schneeleopard, Bär, Windnatter, Mammut und Rhinozeros.\n[q0]Opfermesser der Drakkari\nWird beim Aufheben gebunden"}
