MultiLanguageSpellData['de'][90608] = {name = "[q4]Zin'rokh der Weltenzerstörer", additional_info = "Wirken in 3 sek. 15\n[q]Euren Nachforschungen zufolge war diese Waffe einer der vielen Schätze von Hakkar, dem Seelenschinder, in Zul'Gurub. Hakkar wurde jedoch vor Jahren bezwungen und dieses Schwert unter vielen mächtigen Kriegern und Paladinen weitergereicht, bevor es schließlich brach. Es ist erstaunlich, dass Ihr in der Lage wart, es zu rekonstruieren aber auch ein wenig beunruhigend: wenn der Weltenzerstörer zurückkehrt, ist der Seelenschinder vielleicht nicht weit.\n[q4]Zin'rokh der Weltenzerstörer\nAccountgebunden\nEinzigartigZweihändig Schwert\n1,894 - 2,842 Schaden Tempo 3.80\n(623.16 Schaden pro Sekunde)\n+341 Stärke\n+512 Ausdauer\nHaltbarkeit 120 / 120\n85\n[q2]Anlegen: Erhöht die kritische Trefferwertung um 238.\n[q2]Anlegen: Erhöht die Trefferwertung um 216."}
MultiLanguageSpellData['de'][90609] = {name = "[q0]Kette aus kleinen rosa Perlen", additional_info = "Wirken in 3 sek. 5\n[q]Für sich allein gesehen, sind die Perlen nicht besonders groß. Es ist jedoch bemerkenswert, dass alle zweiundvierzig so gut wie identisch zu sein scheinen. Statt dem Weiß oder dem seltenen Schwarz gewöhnlicher Austernperlen, sind diese hier von einer zarten rosigen Farbe. Eine Pilgermuschelschale als Anhänger rundet das Schmuckstück ab.\n[q0]Kette aus kleinen rosa Perlen\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][90610] = {name = "[q0]Kästchen mit winzigen Glastierchen", additional_info = "Wirken in 3 sek. 5\n[q]Erstaunlicherweise ist es Euch gelungen, eine ganze Menagerie dieser elfischen Glastierchen in ihrer ursprünglichen Aufbewahrungstruhe zu finden. Während einige der Figuren natürlich Sprünge und Risse aufweisen, wurde der Kopf des Hirsches ganz eindeutig mit Absicht abgebrochen. Die Initiale 'T' ist in den Boden der Truhe geschnitzt.\n[q0]Kästchen mit winzigen Glastierchen\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][90611] = {name = "[q0]Gesprungene Kristallphiole", additional_info = "Wirken in 3 sek. 5\n[q]Eine Notiz auf festem Pergament ist an die Flasche gebunden. 'Liebster P., nun da ich weiß, dass wir nie zusammenkommen können, ist es mein Wunsch, diesen Trank aus Spinnengift zu trinken. Solltest Du diese Notiz finden, hoffe ich, dass Du dasselbe tust. Möge Elune über unsere Seelen wachen.'\n[q0]Gesprungene Kristallphiole\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][90612] = {name = "[q0]Szepter von Xavius", additional_info = "Wirken in 3 sek. 5\n[q]Xavius war für viele der Greuel verantwortlich, welche die Nachtelfen während des Krieges der Ahnen erleiden mussten. Malfurion Sturmgrimm gelang es schließlich, Xavius Pläne zu vereiteln, was letztendlich zu dessen Tod führte. Daraufhin folterte Sargeras Xavius' Seele für eine Weile, bis er ihn schließlich mit der verderbten Gestalt des ersten Satyrs 'segnete'.\n[q0]Szepter von Xavius\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][90614] = {name = "[q3]Windspiel der Kaldorei", additional_info = "Wirken in 3 sek. 15\n[q]Dieses Windspiel besteht aus mehreren reichverzierten Bronzeröhren verschiedener Länge, die durch eine rankenförmige Bronzehalterung verbunden sind. Das Artefakt ist magisch und die Glocken erklingen von allein, selbst wenn kein Wind geht.\n[q3]Windspiel der Kaldorei\nWird beim Aufheben gebunden\nSpielzeug\n[q2]Benutzen: Haltet das Windspiel in die Brise, um das Wetter zu überprüfen. (1 Min Abklingzeit)"}
MultiLanguageSpellData['de'][90615] = {name = "Fourth and Goal: Character Earthquake", additional_info = nil}
MultiLanguageSpellData['de'][90616] = {name = "[q4]Königin Azsharas Morgenmantel", additional_info = "Wirken in 3 sek. 15\n[q]Dass Azshara die Schönste aller Nachtelfen war, wird praktisch als Fakt betrachtet. Unglücklicherweise scheint ihr eigenes Auge für Schönheit genauso getrübt gewesen zu sein, wie das ihrer hochgeborenen Untertanen - zumindest den schreienden Farben dieses Gewandes nach zu urteilen.\n\n \"Es gab jemals nur die eine, und es wird jemals nur die eine geben... eine Azshara.\"\n[q4]Königin Azsharas Morgenmantel\nAccountgebunden\nBrust Stoff\n258 Rüstung\n+27 Ausdauer\n+41 Intelligenz\nHaltbarkeit 165 / 165\n51\n[q2]Anlegen: Erhöht die Tempowertung um 23.\n[q]\"Die Gerüchte über den schlechten Modegeschmack der Hochgeborenen scheinen der Wahrheit zu entsprechen.\""}
MultiLanguageSpellData['de'][90617] = {name = "[q0]Gefiederter Raptorenarm", additional_info = "Wirken in 3 sek. 5\n[q]Unter den Mitgliedern der Forscherliga gibt es einige, die glauben, dass Vögel von Dinosauriern wie diesem Raptor abstammen. Die Federn deuten auf das fehlende Verbindungsglied zwischen den zwei Arten hin. Andererseits könnte es auch nur eine weitere der seltsamen Kreaturen sein, die Azeroth heimsuchen.\n[q0]Gefiederter Raptorenarm\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][90618] = {name = "[q0]Bösartiger urtümlicher Fisch", additional_info = "Wirken in 3 sek. 5\n[q]Der skelettierte Fisch wird von schweren Knochenplatten geschützt und seine Kiefer sind mit hunderten nadelartiger Zähne bestückt. Einige glauben, dass einstmals Ozeane alle Kontinente Azeroths bedeckten, weswegen es möglich ist, im tiefsten Binnenland Fischfossilien zu finden.\n[q0]Bösartiger urtümlicher Fisch\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][90619] = {name = "[q4]Fossiler Raptor", additional_info = "Wirken in 3 sek. 15\n[q]Als ihr damit fertig wart, dieses Skelett zusammenzusetzen, wurde es von einer gespenstischen Magie wieder zum Leben erweckt.\n[q4]Fossiler Raptor\nWird beim Aufheben gebunden\nReittier\n40\nBenötigtGeübtes Reiten\n[q2]Benutzen: Lehrt Euch, wie man dieses Reittier beschwört.\n[q2]Beschwört einen reitbaren fossilen Raptor oder gibt ihn wieder frei."}
