MultiLanguageSpellData['de'][90622] = {name = "[q0]Winziger Bronzeskorpion", additional_info = "Wirken in 3 sek. 5\n[q]Allem Anschein nach war dies einst ein lebendiger Skorpion, der in Bronze getaucht wurde, um ihn zu konservieren. Auf der Unterseite steht in Orcisch geschrieben: \"Der Häuptling lacht über Eure erbärmlichen Mordversuche.\"\n[q0]Winziger Bronzeskorpion\nWird beim Aufheben gebunden"}
