MultiLanguageSpellData['de'][90832] = {name = "[q0]Glasierte Lehmkachel", additional_info = "Wirken in 3 sek. 5\n[q]Einstmals müssen viele dieser Kacheln die Wände oder den Boden einer Festung oder eines Empfangssaals auf Draenor geziert haben. Auf diesem Stück ist ein Landstrich dargestellt, der dem heutigen Nagrand sehr ähnelt, auf einem Feld aus gelber und grüner Glasur weiden Herdentiere. Der Rand ist mit einem schwarz-braunen Schachbrettmuster verziert.\n[q0]Glasierte Lehmkachel\nWird beim Aufheben gebunden"}
