MultiLanguageSpellData['de'][90843] = {name = "[q4]Kopfputz des ersten Schamanen", additional_info = "Wirken in 3 sek. 15\n[q]Der Ursprung des Schamanismus bei den Orcs bleibt ein Mysterium. So weit geschichtliche Aufzeichnungen der Orcs auch zurückreichen, wurden stets Schamanen in ihnen erwähnt. Dieser simple Kopfputz ist unfassbar alt. Weder der Name seines Erschaffers noch der des ursprünglichen Trägers werden jemals ans Tageslicht gebracht werden.\n[q4]Kopfputz des ersten Schamanen\nAccountgebunden\nKopf Kette\n720 Rüstung\n+39 Beweglichkeit\n+21 Ausdauer\n\n[q0]Roter Sockel\n[q0]Blauer Sockel\n[q0]Gelber Sockel\n[q0]Sockelbonus: +6 Ausdauer\n\nHaltbarkeit 100 / 100\n61\n[q2]Anlegen: Erhöht die kritische Trefferwertung um 22.\n[q2]Anlegen: Erhöht die Trefferwertung um 22.\n[q2]Benutzen: Gestattet es Euch, weit in die Ferne zu blicken. (1 Min Abklingzeit)"}
