MultiLanguageSpellData['de'][90860] = {name = "[q0]Geschnitzte Harfe aus exotischem Holz", additional_info = "Wirken in 3 sek. 5\n[q]Wie eine Lyra wurde diese kleine Harfe in einer Hand gehalten. Sie hat einen tiefen hölzernen Korpus und sieben Saiten, die um ein Stimmholz geknotet sind. Es ist durchaus noch möglich, auf diesem Instrument Musik zu spielen, allerdings haben alle Töne eine melancholische Färbung...\n[q0]Geschnitzte Harfe aus exotischem Holz\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][90861] = {name = "[q0]Seltsamer silberner Briefbeschwerer", additional_info = "Wirken in 3 sek. 5\n[q]Wenn dieses Objekt von den Draenei nicht als Briefbeschwerer benutzt wurde, dann habt Ihr keine Ahnung, wofür es gut ist. Es ist einfach ein großer Tropfen versteinerten Quecksilbers, der auf einer Seite abgeflacht ist, um auf einem Tisch abgelegt werden zu können.\n[q0]Seltsamer silberner Briefbeschwerer\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][90864] = {name = "[q0]Szepter der Nathrezim", additional_info = "Wirken in 3 sek. 5\n[q]Die Nathrezim, auch als Schreckenslords bekannt, sind die Geheimagenten und Folterspezialisten der Brennenden Legion. Auch wenn sie auf dem Schlachtfeld beeindruckende Gegner sind, bevorzugen sie es, ihre Feinde durch Manipulation und List gegeneinander aufzubringen.\n[q0]Szepter der Nathrezim\nWird beim Aufheben gebunden"}
