MultiLanguageSpellData['de'][90968] = {name = "[q0]Barocke Schwertscheide", additional_info = "Wirken in 3 sek. 5\n[q]Diese Schwertscheide ist so überladen, dass sie schon fast geschmacklos ist. Jeder noch so kleine Teil der Oberfläche wurde verziert, vergoldet oder mit Inschriften versehen. Es ist wahrscheinlich, dass die Waffe, zu der diese Scheide einst gehörte, entweder ein hohes magisches Potenzial hatte oder zu wichtigen zeremoniellen Zwecken diente.\n[q0]Barocke Schwertscheide\nWird beim Aufheben gebunden"}
