MultiLanguageSpellData['de'][90974] = {name = "[q0]Feiner Kristallkandelaber", additional_info = "Wirken in 3 sek. 5\n[q]Dieser Leuchter war für ein ganzes Dutzend Kerzen bestimmt. Blaue und violette Kristalle, untereinander mit feinen Kettchen verbunden, fließen wie Regentropfen an den ornamentverzierten Verstrebungen hinab. Die Initialen des Künstlers sind an einer unauffälligen Stelle eingraviert: 'V. T.'\n[q0]Feiner Kristallkandelaber\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][90975] = {name = "[q0]Würdevolles Porträt", additional_info = "Wirken in 3 sek. 5\n[q]Ein sehr ernsthaftes Porträt eines sehr ernsthaften Draenei. Die Abbildung des Herren ist durchaus schmeichelnd, trotzdem beschleicht Euch das Gefühl, dass der Künstler dem Porträtierten nicht wohlgesinnt war. Ein scharfer Blick an den ganz unteren Rand enthüllt, dass der gute Mann offenbar keine Hose trägt.\n[q0]Würdevolles Porträt\nWird beim Aufheben gebunden"}
