MultiLanguageSpellData['de'][90983] = {name = "[q3]Ankunft der Naaru", additional_info = "Wirken in 3 sek. 15\n[q]Der Kristall scheint eine Art magisches Aufnahmegerät zu sein. Die gespeicherte Nachricht wird in einer Sprache abgespielt, die Ihr nicht vollständig verstehen könnt, Ihr glaubt jedoch, dass sie entweder die Aufnahme oder eine Nachstellung des ersten Kontakts der Eredar mit den Naaru ist.\n[q3]Ankunft der Naaru\nWird beim Aufheben gebunden\nSpielzeug\n[q2]Benutzen: Seht Euch eine Aufnahme von der Ankunft der Naaru an. (3 Min Abklingzeit)"}
MultiLanguageSpellData['de'][90984] = {name = "[q3]Die letzte Reliquie von Argus", additional_info = "Wirken in 3 sek. 15\n[q]Bevor sie auf Azeroth oder Draenor lebten, war die Heimat der Draenei, die sich damals noch Eredar nannten, der Planet Argus. Als Sargeras seine Aufmerksamkeit auf Argus richtete, floh Prophet Velen mit einigen seines Volkes, die sich daraufhin Draenei nannten. Die zurückbleibenden Eredar wurden Teil der Brennenden Legion. Während Velens Flucht nahm jemand diesen einfachen Kristall mit. Eine Inschrift auf der Unterseite lautet \"Ich sehne mich nach Mac'Aree\".\n[q3]Die letzte Reliquie von Argus\nWird beim Aufheben gebunden\n[q2]Benutzen: Teleportiert Euch exakt dorthin, wo Ihr hinwollt... sofern Ihr nicht allzu wählerisch seid. (12 Std. Abklingzeit)\n[q]\"Einer der wenigen Gegenstände, den die Draenei auf ihrer Flucht von Argus mitnehmen konnten.\""}
