MultiLanguageSpellData['de'][90987] = {name = "[q0]Beschlagener Elekktreibstock", additional_info = "Wirken in 3 sek. 5\n[q]Elekk sind mammutähnliche Kreaturen, die auf Draenor heimisch sind, insbesondere in Nagrand. Die Draenei domestizierten Elekk, um sie als Reittiere zu nutzen. Dieser Treibstock ist ein langer und spitzer Stab, der dazu dient, sture Elekk zu motivieren, deren Ausbildung noch nicht abgeschlossen ist.\n[q0]Beschlagener Elekktreibstock\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][90988] = {name = "[q0]Komplizierter Schatztruhenschlüssel", additional_info = "Wirken in 3 sek. 5\n[q]Obwohl die Technologie der Vrykul im allgemeinen hinter der der Horde oder Allianz zurückbleibt, ist die Komplexität dieses einfachen Schlüssels schier unglaublich. In der Kultur der Vrykul ist es üblich, dass die Frau des Haushalts die Schlüssel hütet und sie offen trägt, um ihren Status zu zeigen.\n\n \"Öffnet die Truhe von Dunkelkleriker Salem ganz sicher nicht.\"\n[q0]Komplizierter Schatztruhenschlüssel\nWird beim Aufheben gebunden"}
