MultiLanguageSpellData['de'][90997] = {name = "[q4]Bartaxt aus Niffelvar", additional_info = "Wirken in 3 sek. 15\n[q]Viele von den Vrykul gefertigte Äxte haben einen ungewöhnlichen Stil: der Klingenbart streckt sich sehr weit über das Maß des Axtkopfes hinaus. Durch diese Bauweise, die sowohl für Werkzeuge als auch Waffen vewendet wird, erhöht sich die Schnittfläche, während das Gewicht minimiert wird. Einige zwergische Äxte weisen eine ähnliche Konstruktionsweise auf.\n[q4]Bartaxt aus Niffelvar\nAccountgebunden\nEinhändig Axt\n312 - 580 Schaden Tempo 2.60\n(171.54 Schaden pro Sekunde)\n+36 Beweglichkeit\n+87 Ausdauer\nHaltbarkeit 105 / 105\n71\n[q2]Anlegen: Erhöht die kritische Trefferwertung um 37.\n[q2]Anlegen: Erhöht die Trefferwertung um 24."}
