MultiLanguageSpellData['de'][91008] = {name = "[q0]Skramasax", additional_info = "Wirken in 3 sek. 5\n[q]Ein Skramasax ist eine lange, gerade und einschneidige Klinge mit einem simplen Griff, die von vielen Vrykulkriegern als Zweitwaffe getragen wird. Ein weitverbreiteter Kampfstil von Kriegern gibt eine Axt in der Haupthand und ein Skramasax in der Schildhand vor.\n[q0]Skramasax\nWird beim Aufheben gebunden"}
