MultiLanguageSpellData['de'][91012] = {name = "[q0]Zündzeug", additional_info = "Wirken in 3 sek. 5\n[q]Dieses einfache Paar von Feuerstein und Stahl wurde zum Feuerschlagen genutzt. Die Halterung des Stabes ist wie ein Drachenkopf geformt, die flache Metallklinge zeigt ein stilisiertes Fischmotiv.\n[q0]Zündzeug\nWird beim Aufheben gebunden"}
