MultiLanguageSpellData['de'][91014] = {name = "[q0]Zahnbesetzte Umhangfibel", additional_info = "Wirken in 3 sek. 5\n[q]Diese Gewandschließe diente einst dazu, den schweren Umhang eines Vrykul um die Schultern zu befestigen. An dem kreuzförmigen Bügel sind zwei große, jedoch abgestumpfte Zähne angebracht. Sie stammen wahrscheinlich von einem gealterten Protodrachen. Es ist unklar, ob der Besitzer eine Zuneigung zu dem alten Drachen hatte oder ob die Kreatur die einzige war, die er bezwingen konnte.\n[q0]Zahnbesetzte Umhangfibel\nWird beim Aufheben gebunden"}
