MultiLanguageSpellData['de'][91209] = {name = "[q0]Krug mit Jormungarblut", additional_info = "Wirken in 3 sek. 5\n[q]Dieses Glasbehältnis ist mit dem eiskalten, ätzenden Blut von Nordends großen Jormungarwürmern gefüllt. Legenden zufolge nutzten die Neruber die Jormungar, um die unterirdischen Passagen und Grotten zu schaffen, in denen die beeindruckenden Städte Azjol-Nerubs erbaut waren.\n[q0]Krug mit Jormungarblut\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][91211] = {name = "[q0]Zerknittertes Fahnenband des Wesirs", additional_info = "Wirken in 3 sek. 5\n[q]Dieses seltsame Objekt ist anscheinend Teil einer Schriftrolle von immensen Ausmaßen. Sie besteht aus mit Papyrus beklebtem Leder und ist in blutroter Tinte mit Diagrammen und nerubischer Schrift bedeckt.\n\n \"Unhhh-tikk-a-shisss. Kka shir. Na-l bkah a-shisss. Kreesh kik ik ta. Sohk-a tik hiss a-k-k-k.\"\n[q0]Zerknittertes Fahnenband des Wesirs\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][91212] = {name = "Anstürmen", additional_info = "45 Meter Reichweite\n{Sofort} {3 sek. Abklingzeit}\n[q]Stürmt auf einen Gegner zu, fügt ihm sowie seinen nahen Verbündeten 10822 to 12577 Schaden zu und stößt alle betroffenen Ziele zurück."}
MultiLanguageSpellData['de'][91213] = {name = "Zerkrachen", additional_info = "Sofort\n[q]Fügt Gegnern im Umkreis von 10 Metern 19000 to 21000 körperlichen Schaden zu."}
MultiLanguageSpellData['de'][91214] = {name = "[q4]Segen des Alten Gottes", additional_info = "Wirken in 3 sek. 15\n[q]Pwhn'guul i ghawl'fwata ryiu wgah uul'gwan h'iwn guu'lal. Pwhn'guul i ghawl'fwata ryiu wgah uul'gwan h'iwn guu'lal. Pwhn'guul i ghawl'fwata ryiu wgah uul'gwan h'iwn guu'lal.\n[q4]Segen des Alten Gottes\nWird beim Aufheben gebunden\nSpielzeug\n[q2]Benutzen: Erhaltet 20 sec lang den Segen des Alten Gottes. (10 Min Abklingzeit)"}
MultiLanguageSpellData['de'][91215] = {name = "[q4]Puzzlebox des Yogg-Saron", additional_info = "Wirken in 3 sek. 15\n[q]Diese kleine Box hat bewegliche Oberflächen, verschiebbare Angeln und versteckte Scharniere. Dessen ungeachtet scheint es Euch unmöglich, die Box so zu manipulieren, dass sie sich öffnet und ihren Inhalt preisgibt. Es ist schwierig, auch nur den Versuch zu wagen, da das dunkle Artefakt Euch beständig einflüstert, \"Es WAR deine Schuld. Es WAR deine Schuld. Es WAR deine Schuld. Es WAR deine Schuld.\"\n[q4]Puzzlebox des Yogg-Saron\nWird beim Aufheben gebunden\nSpielzeug\n[q2]Benutzen: Macht einen vergeblichen Versuch, die Puzzlebox zu öffnen. (1 Min Abklingzeit)\n[q]\"Extrem schwer zu öffnen.\""}
