MultiLanguageSpellData['de'][91220] = {name = "Erschauerndes Gebrüll", additional_info = "Wirken in 1 sek.\n[q]Ein lautes, markerschütterndes Gebrüll erhallt und versetzt alle in der Nähe befindlichen Feinden 3 sec lang in Angst. Erlittener Schaden hebt den Effekt auf."}
MultiLanguageSpellData['de'][91221] = {name = "[q0]Kriegsschlägel von Brandauge", additional_info = "Wirken in 3 sek. 5\n[q]Eisenthan Brandauge liebte den Kampf und für seine zwei großen Kriegshämmer war er weitbekannt. Ihr habt einen von ihnen wieder zusammengefügt, doch seine Magie hat sich schon lang verflüchtigt. Das heißt also, dass sich der zweite auch noch irgendwo befinden muss und vielleicht noch intakt ist.\n[q0]Kriegsschlägel von Brandauge\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][91222] = {name = "Erschüttert", additional_info = nil}
MultiLanguageSpellData['de'][91223] = {name = "[q0]Stachelverbundstulpen von Zorneshammer", additional_info = "Wirken in 3 sek. 5\n[q]Zorneshammer war einer der mächtigsten Generäle des Schwarzfels. Sein Wappen, das einen flammenschlagenden Amboss zeigt, ist selbst heute noch auf Schilden und Wappenröcken im Schwarzfelz zu sehen. Auch wenn er selbst nicht mehr lebt, tragen noch viele Soldaten der Dunkeleisenzwerge stolz seinen Namen.\n[q0]Stachelverbundstulpen von Zorneshammer\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][91224] = {name = "[q0]Wort von Kaiserin Zoe", additional_info = "Wirken in 3 sek. 5\n[q]Das Wort und der Schwur von Kaiserin Zoe waren einst ein Paar machtvoller magischer Ringe. Der Ring, den Ihr gefunden habt, ist das Wort - leider verlor dieser Ring seine magischen Eigenschaften, als er brach. Der Schwur ist weiterhin verloren, jedoch ist er möglicherweise noch intakt. Die Kaiserin war eine wenig bekannte Herrscherin der Dunkeleisenzwerge, von denen viele ihr Leben an Zoes Faszination für Drachen verloren. Der Versuch, Dracheneier oder Jungtiere zu stehlen, endete oft tödlich.\n[q0]Wort von Kaiserin Zoe\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][91225] = {name = "[q0]Szepter der Bronzebart", additional_info = "Wirken in 3 sek. 5\n[q]Die Bronzebarts sind sowohl ein Zwergenklan als auch die Herrscherfamilie der Zwerge. Die Könige des Hohen Sitzes haben während ihrer Amtszeit viele Szepter abgenutzt. Einer Tradition folgend würde der König seinen ranghöchsten Beratern und Verbündeten sein Szepter für einen Tag übergeben. Das waren harte Tage für die Szepter, die durch Tavernen geschliffen, von Klippen geschleudert und als Troggknüppel verwendet wurden.\n[q0]Szepter der Bronzebart\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][91226] = {name = "[q3]Die Tochter des Gastwirts", additional_info = "Wirken in 3 sek. 15\n[q]Der Legende nach führte Bryher Steinhüter eine florierende Taverne in der Nähe von Loch Modan. Seine Tochter Keelin reiste weit herum und entwickelte schließlich einen gewissen Leumund, der ihren Vater beschämte. Bryher schloss einen Handel mit einem gnomischen Hexenmeister ab - er sollte es bewerkstelligen, dass die Tochter immer in der Nähe ihres Zuhauses bleiben würde. Daraufhin verwandelte der Hexenmeister Keelin in einen Ruhestein, damit sie ihr Weg stets in das Gasthaus zurückführen würde.\n[q3]Die Tochter des Gastwirts\nWird beim Aufheben gebunden\nEinzigartig\nSpielzeug\n[q2]Benutzen: Bringt Euch zurück nach: <Hearthstone Location>. Sprecht mit einem Gastwirt an einem anderen Ort, um Euren Heimatort zu ändern. (30 Min Abklingzeit)"}
MultiLanguageSpellData['de'][91227] = {name = "[q4]Stab des Zaubererthans Thaurissan", additional_info = "Wirken in 3 sek. 15\n[q]Zaubererthan Thaurissan war während des Kriegs der Drei Hämmer der Anführer der Dunkeleisenzwerge. Als er Eisenschmiede an den Bronzebartklan verlor, zog sich Thaurissan in das Rotkammgebirge zurück und gründete eine Stadt, die seinen Namen trug. In dem verzweifelten Versuch, seine Feinde zu bezwingen, beschwor Thaurissan versehentlich den Halbgott Ragnaros, was sowohl zum sofortige Tode des Zaubererthans als auch zum Entstehen der vulkanischen Aktivität des Schwarzfels führte.\n[q4]Stab des Zaubererthans Thaurissan\nAccountgebunden\nZweihändig Stab\n1,047 - 1,571 Schaden Tempo 2.10\n(623.33 Schaden pro Sekunde)\n+512 Ausdauer\n+341 Intelligenz\nHaltbarkeit 120 / 120\n85\n[q2]Anlegen: Erhöht die kritische Trefferwertung um 228.\n[q2]Anlegen: Erhöht die Tempowertung um 228.\n[q2]Anlegen: Erhöht die Zaubermacht um 1.955."}
