MultiLanguageSpellData['de'][91757] = {name = "[q4]Tyrandes Lieblingspuppe", additional_info = "Wirken in 3 sek. 15\n[q]Tyrande Wisperwind ist die Hohepriesterin von Elune und, da sie nunmehr verheiratet ist, nicht mehr die Alleinherrscherin der Nachtelfen. Sie wuchs in der uralten Stadt Suramar auf, die zwar weit vom ersten Brunnen der Ewigkeit entfernt lag, aber nicht weit von den Brüdern Malfurion und Illidan Sturmgrimm. Tyrandes idyllische Kindheit sollte in scharfem Kontrast zu den Härten und Schicksalsschlägen ihres späteren Lebens stehen.\n[q4]Tyrandes Lieblingspuppe\nAccountgebunden\nEinzigartig anlegbarSchmuck\n+321 Intelligenz\n85\n[q2]Anlegen: Gewinnt 20% der Grundmanakosten Eurer Zauber zurück und speichert es in der Puppe, um sie zu einem späteren Zeitpunkt freizugeben. Es können maximal 4200 Mana gespeichert werden.\n[q2]Benutzen: Entfesselt das gesamte in der Puppe gesammelte Mana, wodurch Ihr Mana in entsprechende Höhe gewinnt und allen Gegnern im Umkreis von 15 Metern pro Manapunkt 1 Arkanschaden zufügt. (1 Min Abklingzeit)"}
