MultiLanguageSpellData['de'][91761] = {name = "[q4]Knochen der Transformation", additional_info = "Wirken in 3 sek. 15\n[q]Als der erste Brunnen der Ewigkeit implodierte, sank das kulturelle Zentrum der Nachtelfen auf den Meeresgrund. Um ihrem sicheren Tod zu entfliehen, ging Königin Azshara einen Pakt mit einer größeren Macht ein, wahrscheinlich einem Alten Gott oder einem Elementar. Im Resultat wurden die überlebenden Hochgeborenen von einem Fluch befallen, der sie zu pervertierten, schlangenartigen Kreaturen transfomierte, die heute als Naga bekannt sind.\n[q4]Knochen der Transformation\nWird beim Aufheben gebunden\nSpielzeug\n[q2]Benutzen: Durchlebt 20 sec lang die Transformation. (10 Min Abklingzeit)"}
MultiLanguageSpellData['de'][91762] = {name = "[q0]Collier der einhundert Magi", additional_info = "Wirken in 3 sek. 5\n[q]Während der Trollkriege wurden die Elfen von Quel'Thalas beinahe von den Amani bezwungen. In ihrer Verzweiflung lehrten die Elfen Menschen aus Arathor die Arkanmagie. Sie nahmen nur einhundert Schüler - die minimale Zahl, um die Trolle zu bezwingen. Die Menschen waren plumpe Magier, die jedoch eine natürliche Begabung für Magie hatten.\n[q0]Collier der einhundert Magi\nWird beim Aufheben gebunden"}
