MultiLanguageSpellData['de'][91766] = {name = "[q0]Silberner Schriftrollenbehälter", additional_info = "Wirken in 3 sek. 5\n[q]Dieser elfische Schrifrollenbehälter ist zwar reich verziert, doch ist es die Nachricht, die von größerem Interesse ist: \"Pyramond, du wirst unter keinen Umständen Zeit mit diesem Weibsbild verbringen. Deine Mutter und ich verbieten es. Sie ist ganz eindeutig unter deiner Würde.\"\n[q0]Silberner Schriftrollenbehälter\nWird beim Aufheben gebunden"}
