MultiLanguageSpellData['de'][91769] = {name = "[q0]Schattensichel", additional_info = "Wirken in 3 sek. 5\n[q]Diese Art kreisrunder Klingen wird seit Ewigkeiten von nachtelfischen Wachen bevorzugt. Eine bekannte Trägerin dieses Waffentyps war Maiev Schattensang, jedoch werden die Klingen auch heute noch von Nachtelfen genutzt, beispielsweise den Tiefenwächtern der Grabhügel des Hyjal. Es ist wahrscheinlich, dass die von Euch gefundene Waffe magische Qualitäten aufwies, bevor sie in so viele Fragmente zerbrach.\n[q0]Schattensichel\nWird beim Aufheben gebunden"}
