MultiLanguageSpellData['de'][91773] = {name = "[q4]Irrwischamulett", additional_info = "Wirken in 3 sek. 15\n[q]Irrwische sind Naturgeister, angeblich verstorbene Nachtelfen. Sie haben eine starke Verbindung zu den Wäldern ihrer Heimat sowie den Nachtelfen im allgemeinen und führen für sie dienliche Dinge aus, wie die Konstruktion oder Reparatur von Bauten und die Verteidigung elfischer Gemeinschaften. Viele Irrwische opferten sich am Ende des Dritten Krieges, um Archimondes Zerstörung herbeizuführen, dadurch gibt es heutzutage weniger Irrwische, als einst.\n[q4]Irrwischamulett\nWird beim Aufheben gebunden\nSpielzeug\n[q2]Benutzen: Nehmt 20 sec lang eine Irrwischgestalt an. (10 Min Abklingzeit)"}
