MultiLanguageSpellData['de'][91775] = {name = "[q0]Sandburg", additional_info = "Wirken in 3 sek. 5\n[q]Das ist eine kleine, rechteckige Festung aus Sand. Die Form der Türme und das Sonnenmotiv deuten auf Architektur der Tol'vir hin, eine entsprechende Festung in realem Maßstab habt Ihr jedoch noch nicht in Uldum gesehen. Das Objekt ist tatsächlich aus Sand, nicht Sandstein und Ihr seid Euch nicht sicher, wovon es zusammengehalten wird.\n[q0]Sandburg\nWird beim Aufheben gebunden"}
