MultiLanguageSpellData['de'][91779] = {name = "[q0]Katzenstatuette mit Smaragdaugen", additional_info = "Wirken in 3 sek. 5\n[q]Die kleine tönerne Katze ist in lebensechter Position und mit regem Ausdruck dargestellt. Auf der Unterseite steht geschrieben, 'In Erinnerung an Chalyx, geliebtes Haustier des Imperators Ninjter.'\n[q0]Katzenstatuette mit Smaragdaugen\nWird beim Aufheben gebunden"}
