MultiLanguageSpellData['de'][91782] = {name = "[q0]Winziges Oasenmosaik", additional_info = "Wirken in 3 sek. 5\n[q]Dieses kleine Kunstwerk habt Ihr aus seinen vielen kleinen verstreuten Tonkacheln wieder zusammengesetzt, seine satten Farben leuchten Euch türkiswasserblau, palmengrün und sandgelb entgegen.\n\n \"Unsere Hoffnung und Gebete für Imperator Ninjter, möge er der Hungersnot ein Ende setzen und den Ruhm der Ramkahen erneuern!\"\n[q0]Winziges Oasenmosaik\nWird beim Aufheben gebunden"}
