MultiLanguageSpellData['de'][91785] = {name = "[q0]Graviertes Krummsäbelheft", additional_info = "Wirken in 3 sek. 5\n[q]Dieser Krummsäbel scheint eher Zierat denn eine echte Waffe gewesen zu sein. Die Klinge endet nach nur einer Handbreite und scheint nie im Kampf genutzt worden zu sein. Ein Spruchband umringt den Schwertknauf und zieht sich dann auf das Heft weiter, es besagt: 'Möge Imperator Ninjter uns zum Sieg führen! Kadesh! Osadi! Satekh!'\n[q0]Graviertes Krummsäbelheft\nWird beim Aufheben gebunden"}
