MultiLanguageSpellData['de'][91790] = {name = "Kanope", additional_info = "Wirken in 3 sek. 5\n[q]Dieses Gefäß enthält die versteinerten inneren Organe von Imperator Ninjter. Offenbar starb er nur wenige Jahre, nachdem er seine vom Volk voller Hoffnung erwartete Herrschaft antrat.\nWird beim Aufheben gebunden\n[q2]<Zum Öffnen rechtsklicken>"}
