MultiLanguageSpellData['de'][91792] = {name = "[q0]Skizze eines Wüstenpalastes", additional_info = "Wirken in 3 sek. 5\n[q]Dies ist ein Bauplan und anscheinend träumte der Architekt in sehr großem Maßstab. Euch ist kein Gebäude dieser Art im heutigen Uldum bekannt, vermutlich ist dieser Palast also niemals erbaut worden.\n\n \"In Auftrag gegeben für Imperator Ninjter.\"\n[q0]Skizze eines Wüstenpalastes\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][91793] = {name = "[q0]Franclorn Schmiedevaters Pfeife", additional_info = "Wirken in 3 sek. 5\n[q]Schmiedevater war ein gefeierter Architekt des Dunkeleisenklans. Er beaufsichtigte, unter anderem, die Erbauung des Steinwerkdamms und eines Großteils der Schwarzfelstiefen. Es heißt, sein Geist geht noch immer im Schwarzfels um.\n[q0]Franclorn Schmiedevaters Pfeife\nWird beim Aufheben gebunden"}
