MultiLanguageSpellData['de'][92137] = {name = "[q4]Eiskaltes Händchen", additional_info = "Wirken in 3 sek. 15\n[q]Eine Legende der Tol'vir erzählt von einem bösen Dschinn, den die Ramkahen zerstören wollten. In dem Versuch, seinen eigenen Tod zu verhindern, ließ der Dschinn seinen Geist in den Körper eines Affen übergehen. Er wurde während des Transfers getötet, und nur ein Teil seiner Essenz war übertragen worden - gerade genug, um von der Hand des Affen Besitz zu ergreifen.\n[q4]Eiskaltes Händchen\nWird beim Aufheben gebunden\n[q2]Benutzen: Lehrt Euch, wie man dieses Haustier beschwört.\n[q2]Mit Rechtsklick Euer eiskaltes Händchen beschwören oder wieder freigeben."}
