MultiLanguageSpellData['de'][92139] = {name = "[q4]Stab von Ammunae", additional_info = "Wirken in 3 sek. 15\n[q]Ammunae ist einer der Wächter der Hallen des Ursprungs. Wie auch die anderen Konstrukte in den Hallen, wurde Ammunae erschaffen, um den Mechanismus zu bewachen, der zum Zurücksetzen allen Lebens in Azeroth befähigt war. Jeder der Wächter hat einen eigenen Einflußbereich. Isiset steht der Magie vor, Ammunae dem Leben, Setesh dem Chaos und Rajh der Sonne.\n[q4]Stab von Ammunae\nAccountgebunden\nZweihändig Stab\n1,196 - 1,795 Schaden Tempo 2.40\n(623.13 Schaden pro Sekunde)\n+512 Ausdauer\n+341 Intelligenz\n+247 Willenskraft\nHaltbarkeit 120 / 120\n85\n[q2]Anlegen: Erhöht die kritische Trefferwertung um 194.\n[q2]Anlegen: Erhöht die Zaubermacht um 1.955.\n[q]\"Achusenmen osadi djahi kahun Ammunae\""}
