MultiLanguageSpellData['de'][92145] = {name = "[q4]Anhänger des Skarabäussturms", additional_info = "Wirken in 3 sek. 15\n[q]Während der Amtszeit von Pharao Tebhotep suchte eine Schlangenplage den Fluss Vir'naal heim. Nichts und niemand war in der Lage, der Reptilien Herr zu werden. Danach erschien eine zweite Plage, Wüstenskarabäen diesmal. Die Skarabäen und Schlangen bekämpften einander, bis kein einziger von ihnen mehr übrig war und Frieden kehrte wieder ins Land ein.\n[q4]Anhänger des Skarabäussturms\nAccountgebunden\nSpielzeug\n[q2]Benutzen: Beschwört einen Sturm friedlicher Skarabäen. (10 Min Abklingzeit)"}
