MultiLanguageSpellData['de'][92148] = {name = "[q4]Szepter von Azj'Aqir", additional_info = "Wirken in 3 sek. 15\n[q]Die Aqir waren ein unglaublich böses, expansionistisches Insektenvolk, das jahrtausendelang die Trollimperien bekämpfte. Letztendlich spaltete sich die große Azj'Aqir-Zivilisation in zwei Teile, das Königreich Azjol-Nerub im Norden und das Imperium Ahn'Qiraj im Süden. Schließlich gelang es den Nachtelfen, die Qiraji lange Zeit einzudämmen, bevor sie vom Alten Gott C'thun wiedererweckt wurden.\n[q4]Szepter von Azj'Aqir\nWird beim Aufheben gebunden\nEinzigartig\nReittier\n40\nBenötigtGeübtes Reiten\n[q2]Benutzen: Lehrt Euch, wie man eine ultramarineblaue Qirajipanzerdrohne beschwört.\n[q2]Beschwört eine reitbare ultramarinblaue Qirajipanzerdrohne oder gibt sie wieder frei."}
