MultiLanguageSpellData['de'][93441] = {name = "[q0]Halskette mit Anhänger der Elune", additional_info = "Wirken in 3 sek. 5\n[q]Elune ist die oberste Gottheit der Nachtelfen. Sie wird mit dem größeren der beiden Monde in Verbindung gebracht, der Weißen Dame. Obwohl sie eine Göttin des Friedens ist, so ist sie dennoch nicht pazifistisch. Einer ihrer Aspekte ist die Nachtkriegerin, welche die Seelen derer, die sich im Leben als tapfer erwiesen, als Sterne über den Nachthimmel reiten lässt.\n[q0]Halskette mit Anhänger der Elune\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][93442] = {name = "[q0]Stück versteinertes Holz", additional_info = "Wirken in 3 sek. 5\n[q]Auch wenn von dem ursprünglichen Holz nichts mehr vorhanden ist, so ist doch seine Maserung perfekt erhalten. Diese Pflanze war vermutlich ein Exemplar einer Palmen- oder Palmfarnart.\n[q0]Stück versteinertes Holz\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][93443] = {name = "[q0]Seltsamer pelziger Wurm", additional_info = "Wirken in 3 sek. 5\n[q]Dieses Fossil scheint eine Art fehlendes Verbindungsglied zu sein. Es zeigt sowohl Merkmale von Gliederfüßern als auch Würmern. Sein Körper hat die Gestalt eines Wurms, jedoch insekten- oder krebstierartige Stummelbeine. Anscheinend war die Kreatur auch gänzlich von seidigen Haaren bedeckt.\n[q0]Seltsamer pelziger Wurm\nWird beim Aufheben gebunden"}
MultiLanguageSpellData['de'][93444] = {name = "[q0]Feines Besteck der Blutskalpe", additional_info = "Wirken in 3 sek. 5\n[q]Gut, es ist wirklich nur ein großes Messer - aber in einer Kultur wie dem Blutskalpstamm zählt jegliches zum Essen verwendetes Werkzeug als feines Besteck.\n[q0]Feines Besteck der Blutskalpe\nWird beim Aufheben gebunden"}
