MultiLanguageSpellData['de'][98556] = {name = "[q3]Heimgesuchte Kriegstrommel", additional_info = "Wirken in 3 sek. 15\n[q]Vor langer Zeit ließen sich die fanatischsten der trollischen Kriegstrommler bei lebendigem Leib schinden, um das Fell für ihre kostbaren Instrumente zu stellen. Obwohl die unglaublichen natürlichen Wiederherstellungskräfte der Trolle es möglich machten, diese Tortur zu überleben, war der Vorgang lang und qualvoll und trieb viele vor Schmerzen in den Wahnsinn. Man sagt, dass der Geist eines Trommlers, der beim Spielen eines solchen Instruments getötet wurde, in die Trommel überging...\n[q3]Heimgesuchte Kriegstrommel\nWird beim Aufheben gebunden\nSpielzeug\n[q2]Benutzen: Platziert eine heimgesuchte Kriegstrommel und hört ihr zu. (30 Min Abklingzeit)"}
