MultiLanguageSpellData['de'][98560] = {name = "[q3]Uralter Bernstein", additional_info = "Wirken in 3 sek. 15\n[q]Die winzige humanoide Figur, die in diesem massiven Bernsteinbrocken steckt, ist in ihren Details nicht erkennbar. Ihre Umrisse werden verzerrt und bleiben selbst unter genauester Betrachtung verschwommen. Jene, welche dieses Objekt zu lang betrachten, beschleicht ein Gefühl der Unruhe - als hätte sich in den letzten Jahrtausenden eine bizarre, überirdische Kraft in diesem Fossil angereichert.\n[q3]Uralter Bernstein\nWird beim Aufheben gebunden\nSpielzeug\n[q2]Benutzen: Ihr werdet in Bernstein gefangen. (30 Min Abklingzeit)"}
