MultiLanguageSpellData['de'][98569] = {name = "[q3]Trinkhorn der Vrykul", additional_info = "Wirken in 3 sek. 15\n[q]Entgegen der verbreiteten Auffassung waren Trinkhörner bei den Vrykul nicht weit verbreitet. Während die Mehrheit Met oder Bier aus Schalen oder Bechern trank, benutzten nur diejenigen mit hohem Prestige kunstvolle Hörner wie dieses. Selbst das Reichen eines solchen Gefäßes an einen Vrykul war mit einer Zeremonie verbunden, die gewöhnlich von der höchstrangigen anwesenden Frau unter förmlichen Verkündigungen von Rang und Taten vollzogen wurde.\n[q3]Trinkhorn der Vrykul\nWird beim Aufheben gebunden\nSpielzeug\n[q2]Benutzen: Trinkt aus dem Trinkhorn der Vrykul."}
