MultiLanguageSpellData['de'][98588] = {name = "[q3]Voodoostatuette", additional_info = "Wirken in 3 sek. 15\n[q]Voodoostatuetten wie diese wurden gebaut und belebt, um Hexendoktoren in kleineren alltäglichen Aufgaben zur Hand zu gehen, wie zum Beispiel dem Waschen von Lendenschurzen oder dem Entfernen von Blut vom Hüttenboden. Sie wurden oft von Mojofläschchen, Trollschweiß, dem Fleisch von Stammesfeinden oder DEM VERZEHR WINZIGER TEILE DER SEELEN IHRER BESITZER angetrieben. Aber keine Sorge. Winzige, klitzekleine Teile. Ihr werdet gar nicht bemerken, dass sie weg sind. Und bedenkt, wie sauber Eure Fußböden sein werden!\n[q3]Voodoostatuette\nWird beim Aufheben gebunden\n[q2]Benutzen: Lehrt Euch, wie man dieses Haustier beschwört.\n[q2]Mit Rechtsklick Eure Voodoostatuette beschwören oder wieder freigeben."}
