MultiLanguageSpellData['de'][348704] = {name = "Siegel der Verderbnis", additional_info = "14% von Grundmana\nSofort\n[q]Erfüllt den Paladin mit heiliger Macht, wodurch Angriffe den Effekt 'Blutverderbnis' auslösen, der im Verlauf von 15 sec [(0.013 * Spell power + 0.025 * Attack power) * 5] zusätzlichen Heiligschaden verursacht. 'Blutverderbnis' ist bis zu 5-mal stapelbar. Außerdem verursacht jeder Angriff des Paladins zusätzlich bis zu 15% Waffenschaden als zusätzlichen Heiligschaden abhängig von der Anzahl der Stapel. Es kann immer nur jeweils ein Siegel auf dem Paladin aktiv sein. Hält 30 min lang an.\n\n Die Entfesselung der Energie dieses Siegels fügt einem Gegner (1 + 0.22 * Spell power + 0.14 * Attack power) Heiligschaden zu, dieser Schaden wird für jeden Stapel von 'Blutverderbnis' auf dem Ziel um 10% erhöht."}
